// Oprateurs ($gt, $in...)
db.users.find({ age: { $gt: 25 } }) // age > 25
db.users.find({ skills: { $in: ["Python"] } }) // contient Python`},{id:"mongo_update",title:"Mettre  jour (Update)",description:"Modifier des documents.",level:"beginner",tags:["mongodb","update","crud"],code:`// Modifier le premier trouv
db.users.updateOne(
    { name: "Alice" }, // Filtre
    { $set: { age: 26 } } // Action ($set, $inc...)
)

// Modifier tous les matchs
